      fetch('https://jsonplaceholder.typicode.com/posts')
      .then(response => response.json())
      .then(data => console.log(data))
    
    },[])
    

  return (
    <div>
         <div>{page.map(({id,title,body})=>{
            return(
                <div>
                    <h1>{id}</h1>
                    <h1>{title}</h1>
                    <h1>{body}</h1>
                </div>

            )
         })}</div>   
         
            


    </div>
  )
}

